      % Rotating delay state position
      adts = mod(ts+5,7)+1;
    
    % Input 1
    % no processing
    
    % Layer 1
    tapdelay1 = cat(1,Ad1{mod(adts-[1 2 3 4 5 6]-1,7)+1});
    Ad1{adts} = tansig_apply(repmat(b1,1,Q) + IW1_1*X{1,ts} + LW1_1*tapdelay1);
    
